import React,{useState} from 'react';

function App() {
  const [pokemonName, setPokemonName] = useStaste("");
  return (
    <div className="App">
      <div className="TitleSection">
      <h1>Pokemon Stats</h1>
      <input type="text"
       placeholder='Pokemon'
       onChange={(event)=>{
        // get the value of the input using useState hook
        setPokemonName(event.target.value);
       }}
       />
      <button>Search</button>
      </div>
    </div>
  );
}

export default App;
